import logo from './logo.svg';
import './App.css';
import React from 'react';

function App() {
    const blogOjb = {
      title: 'Test',
      desc: 'Testtestetst'
    }
  return (
    <div className="App">
      <div>
        {createP()}
        <h3>{blogOjb.title}</h3>
        <p>{blogOjb.desc}</p>
      </div>
    </div>
  );
}

function createP(){
  return React.createElement('p', 'test')
}

export default App;
